import{_ as o,c as t,o as e,ak as r}from"./chunks/framework.CmzJUe0_.js";const s="/assets/20221112192630.vKOLoEkG.png",n="/assets/20221112192819.CN-2MnJT.png",i="/assets/20221112192945.CU1udTGb.png",l="/assets/20221112195425.10DGU4x6.png",b=JSON.parse('{"title":"window系统读取群晖的拆机硬盘","description":"","frontmatter":{"title":"window系统读取群晖的拆机硬盘","date":"2022-11-12T00:00:00.000Z","sidebar":"auto","categories":["随笔"]},"headers":[],"relativePath":"blogs/随笔/window系统读取群晖的拆机硬盘.md","filePath":"blogs/随笔/window系统读取群晖的拆机硬盘.md"}'),p={name:"blogs/随笔/window系统读取群晖的拆机硬盘.md"};function _(d,a,c,h,w,m){return e(),t("div",null,a[0]||(a[0]=[r('<h1 id="window系统读取群晖的拆机硬盘" tabindex="-1">window系统读取群晖的拆机硬盘 <a class="header-anchor" href="#window系统读取群晖的拆机硬盘" aria-label="Permalink to &quot;window系统读取群晖的拆机硬盘&quot;">​</a></h1><h2 id="使用场景" tabindex="-1">使用场景： <a class="header-anchor" href="#使用场景" aria-label="Permalink to &quot;使用场景：&quot;">​</a></h2><p>当群晖NAS系统出现问题或者不想使用群晖NAS系统后。如何在windows系统环境下把群晖NAS系统中的存储的数据迁移出来？</p><p>群晖nas系统的存储方式： 群晖nas的硬盘分区用的是Btrfs分区格式。在windows环境下是无法读取硬盘中的数据的，无法识别。</p><h2 id="解决方法" tabindex="-1">解决方法 <a class="header-anchor" href="#解决方法" aria-label="Permalink to &quot;解决方法&quot;">​</a></h2><h3 id="_1-解决方法1-已使用" tabindex="-1">① 解决方法1： 已使用 <a class="header-anchor" href="#_1-解决方法1-已使用" aria-label="Permalink to &quot;① 解决方法1： 已使用&quot;">​</a></h3><p>使用UFS_Explorer_Professional_Recovery 数据恢复软件</p><p><span style="color:red;">只有注册后的该软件才能迁移大容量文件数据。</span></p><ol><li>安装UFS_Explorer_Professional_Recovery 数据恢复软件</li></ol><p>软件运行截图 <img src="'+s+'" alt="20221112192630.png"></p><ol start="2"><li>使用该软件的注册机进行破解</li></ol><p><img src="'+n+'" alt="20221112192819.png"></p><p>将注册机中的序列码复制到下图位置中，点击ok。就能破解</p><p><img src="'+i+'" alt="20221112192945.png"></p><ol start="3"><li><p>将群晖的拆机硬盘通过硬盘盒子的方式。连接到windows主电脑中。</p></li><li><p>运行该软件，在软件中找到群晖拆机硬盘。点击硬盘中可以显示其中的数据。</p></li></ol><p><img src="'+l+'" alt="20221112195425.png"></p><p>上图可以看到该软件成功读取了群晖的btrfs分区硬盘数据。并且可以将硬盘中的文件迁移到主电脑中。</p><h3 id="_1-解决方法2-未使用" tabindex="-1">① 解决方法2： 未使用 <a class="header-anchor" href="#_1-解决方法2-未使用" aria-label="Permalink to &quot;① 解决方法2： 未使用&quot;">​</a></h3><p>将Ubuntu的iso文件制作为启动U盘。用这个启动U盘来试运行Ubuntu系统。接入群晖拆机硬盘到主电脑上，然后在ubuntu系统下读取群晖拆机硬盘数据。</p><p><a href="https://www.chiphell.com/thread-708972-1-1.html" target="_blank" rel="noreferrer">参考链接</a></p>',20)]))}const f=o(p,[["render",_]]);export{b as __pageData,f as default};
